import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

console.log(notes);

export default function App() {
  return (
    <h1 className="App">
      <Header />
      <Note 
        title = "This is our title"
        content = "This is our content"
      />
      <Footer />
    </h1>
  );
}
